DROP TABLE IF EXISTS `gt_trainees`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `gt_trainees` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint unsigned DEFAULT NULL,
  `follow_up` bigint unsigned DEFAULT NULL,
  `trainer_id` bigint unsigned DEFAULT NULL,
  `branch_id` bigint unsigned NOT NULL,
  `full_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `notes` text COLLATE utf8mb4_unicode_ci,
  `attend_type` enum('Online','Offline','Hybrid','Private') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `level` bigint unsigned DEFAULT NULL,
  `payment_type` bigint unsigned DEFAULT NULL,
  `preferable_time` bigint unsigned DEFAULT NULL,
  `sec_preferable_time` bigint unsigned DEFAULT NULL,
  `current_list` bigint unsigned DEFAULT NULL,
  `pervious_list` bigint unsigned DEFAULT NULL,
  `test_date` timestamp NULL DEFAULT NULL,
  `moved_date` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `gt_trainees_user_id_foreign` (`user_id`),
  KEY `gt_trainees_follow_up_foreign` (`follow_up`),
  KEY `gt_trainees_trainer_id_foreign` (`trainer_id`),
  KEY `gt_trainees_branch_id_foreign` (`branch_id`),
  KEY `gt_trainees_level_foreign` (`level`),
  KEY `gt_trainees_payment_type_foreign` (`payment_type`),
  KEY `gt_trainees_preferable_time_foreign` (`preferable_time`),
  KEY `gt_trainees_sec_preferable_time_foreign` (`sec_preferable_time`),
  KEY `gt_trainees_current_list_foreign` (`current_list`),
  KEY `gt_trainees_pervious_list_foreign` (`pervious_list`),
  CONSTRAINT `gt_trainees_branch_id_foreign` FOREIGN KEY (`branch_id`) REFERENCES `gt_branches` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_current_list_foreign` FOREIGN KEY (`current_list`) REFERENCES `gt_lists` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_follow_up_foreign` FOREIGN KEY (`follow_up`) REFERENCES `gt_users` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_level_foreign` FOREIGN KEY (`level`) REFERENCES `gt_generalmeta` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_payment_type_foreign` FOREIGN KEY (`payment_type`) REFERENCES `gt_generalmeta` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_pervious_list_foreign` FOREIGN KEY (`pervious_list`) REFERENCES `gt_lists` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_preferable_time_foreign` FOREIGN KEY (`preferable_time`) REFERENCES `gt_generalmeta` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_sec_preferable_time_foreign` FOREIGN KEY (`sec_preferable_time`) REFERENCES `gt_generalmeta` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_trainer_id_foreign` FOREIGN KEY (`trainer_id`) REFERENCES `gt_users` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `gt_trainees_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `gt_users` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2845 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
